circularGraph() {

	const circularDeps = this.circular();



	return Object.entries(this.obj())

		.filter(([k]) => circularDeps.some((x) => x.includes(k)))

		.reduce((acc, [k, v]) => {

			acc[k] = v.filter((x) => circularDeps.some((y) => y.includes(x)));

			return acc;

		}, {});

}
